export default function Sidebar() {
  return (
    <div className="sidebar">
      <h2>Navigation</h2>
      <ul>
        <li>Dashboard</li>
        <li>Add Product</li>
        <li>Inventory List</li>
        <li>Settings</li>
      </ul>
    </div>
  );
}
